import React from 'react';
import ReactDom from 'react-dom';
import faker from 'faker';
import CommentDetail from './CommentDetail';
import ApprovalCard from './ApprovalCard';

const App = () => {
	// https://semantic-ui.com for css styling
	return (
		<div className="ui container comments">
			<ApprovalCard>
				<CommentDetail avatar={faker.image.avatar()} author="Roscoe" timeAgo="2pm" commentText="Want to Nap!" />
			</ApprovalCard>
			<ApprovalCard>
				<CommentDetail avatar={faker.image.avatar()} author="Rory" timeAgo="3pm" commentText="Want to Play!" />
			</ApprovalCard>
			<ApprovalCard>
				<CommentDetail avatar={faker.image.avatar()} author="Lulu" timeAgo="4pm" commentText="Want to Eat!" />
			</ApprovalCard>
		</div>
	);
};

ReactDom.render(<App />, document.querySelector('#root'));
